import { configureStore } from "@reduxjs/toolkit";
import trainingManagerReducer from "../redux/sessions/trainingManagerSlice";
import authReducer from "../redux/auth/authSlice";

export const store = configureStore({
  reducer: {
    trainingManager: trainingManagerReducer,
    auth: authReducer,
  },
});
